  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0130793 includes physical
  and profile data collected aboard the Pacific Storm during project M-M928-KR-09
  in the North Pacific Ocean from 2009-08-07 to 2009-09-23. These data include SOUND
  VELOCITY. The instruments used to collect these data include sound velocimeter -
  moving vessel profiler. These data were collected and submitted by the NOAA Office
  of Coast Survey in support of hydrographic multibeam surveys to meet NOAA charting
